import axios from 'axios'

const url = 'https://api.covid19india.org/state_district_wise.json'

export const fetchData = async () => {
    try {
        const { data: { Assam, Manipur, Meghalaya, Mizoram, Nagaland, Tripura } } = await axios.get(url);
        const modifiedData = {
            Assam: Assam,
            Manipur: Manipur,
            Meghalaya: Meghalaya,
            Mizoram: Mizoram,
            Nagaland: Nagaland,
            Tripura: Tripura
        }
        // return re Assam: data[28],
        //console.log(response)
        return modifiedData;

    } catch (error) {

    }
}
